import React from 'react';
import Alert from 'react-bootstrap/Alert';

function Example() {
  return (
    <Alert dismissible variant="danger">
      <Alert.Heading>Hello there Mates!</Alert.Heading>
      <p>
        This is frying my brains.
      </p>
    </Alert>
  )
}

export default Example;
